INSERT INTO `contact` VALUES (3,'Вика','89111134556','mow',3.4,1,1,'Визажист, бровист, мастер по перманентному макияжу.\nВстречаюсь исключительно ради удовольствия и только с кем мне приятно общаться!','5315d3bd-8642-11ee-84d2-005056c00001'),(4,'Яна','89111134556','mow',3.8,1,2,'Профессионально танцевала в разных элитных клубах Москвы и Екб, стриптиз и го-го. Участвовала в подтанцовке у многих звёзд. Люблю весело и интересно проводить время в компании обеспеченных мужчин','5315e532-8642-11ee-84d2-005056c00001'),(5,'Ира','89111134556','mow',3.2,1,3,'Я студентка учусь в мед. институте, увлекаюсь танцами и аэробикой. Хочу найти мужчину с которым могу встречаться на постоянной основе за материальную помощь. Я очень общительная и раскрепощённая','5315e707-8642-11ee-84d2-005056c00001'),(6,'Алина','89111134556','mow',3.7,1,4,'Люблю тусовки и ночную жизнь. Много лет занималась эскортом в ОАЭ и Европе, танцевала в элитных клубах стриптиз. Учусь на психолога и катаюсь на мерседесе.','5315e86d-8642-11ee-84d2-005056c00001'),(7,'Виктория','89111134556','mow',3.8,1,5,'Закончила школу с золотой медалью, а институт с красным дипломом. Я юрист по образованию, работаю по специальности. Умница, красавица, призёр различных конкурсов красоты. Хочу выйти замуж за состоятельного мужчину, но с радостью соглашусь стать содержанкой. Одноразовые встречи не рассматриваю, и общаюсь только по взаимной симпатии.','5315eaaf-8642-11ee-84d2-005056c00001'),(8,'Полина','89111134556','mow',0,0,6,'','5315ec21-8642-11ee-84d2-005056c00001'),(9,'Вкусняшка','89111134556','mow',0,0,7,'','5315ed73-8642-11ee-84d2-005056c00001'),(10,'Анна','89111134556','mow',3.2,1,8,'Высшее образование, PR-менеджер. Работаю в агентстве недвижимости, раньше был свой салон красоты. Люблю путешествия, хожу в спортзал, занимаюсь верховой ездой, горными лыжами. Хорошо готовлю, одни из любимых блюд самса, шурпа, стейки. Не курю, выпиваю иногда. Была в браке 13 лет, ребенку 9. Есть загранпаспорт, шенген, вожу автомобиль, допускаю переезд (Америка, Европа, Великобритания).','5315eefd-8642-11ee-84d2-005056c00001'),(11,'Диана','89111134556','mow',0,0,9,'','5315f070-8642-11ee-84d2-005056c00001'),(12,'Анжела','89111134556','mow',0,0,10,'','5315f1bb-8642-11ee-84d2-005056c00001'),(13,'Светлана','89111134556','mow',3.6,1,11,'Персональный стилист и визуализатор бренда, регулярно прохожу дополнительные обучения, занимаюсь духовным практиками и развитием. ысшее образование по специальности менеджмент, есть водительские права, английский неуверенный. Победительница полномасштабного реалити шоу, получила звание «самая прекрасная женщина» и миллион рублей. Не пью вообще, не курю. Активно развиваю инстаграм, много в него вкладываю. Моя работа для меня как хобби и отдых, но свободное время могу проводить по-разному, все зависит от настроения, как правило это что-то спокойное и умиротворенное. Вегетарианка, но иногда ем рыбу или морепродукты. Я хочу создать семью, родить детей с надежным мужчиной, желательно русским, так как менталитет иностранца может быть чужд.','5315f352-8642-11ee-84d2-005056c00001'),(14,'Кристина','89111134556','mow',4,1,12,'Самодостаточная леди, профессиональная фотомодель, и победительница различных конкурсов красоты. Много путешествую, живу одна, люблю готовить и шопится. Всегда в поисках новых отношений.','5315f92e-8642-11ee-84d2-005056c00001'),(15,'Соня','89111134556','mow',3,1,13,'Милая студентка, учусь в педагогическом институте, люблю потусить с друзьями и весело проводить время. Хочу нечастых но интересных встреч с обеспеченным мужчиной.','5315faa8-8642-11ee-84d2-005056c00001'),(16,'Роза','89111134556','mow',4.2,1,14,'Персональный стилист и визуализатор бренда, регулярно прохожу дополнительные обучения, занимаюсь духовным практиками и развитием. ысшее образование по специальности менеджмент, есть водительские права, английский неуверенный. Победительница полномасштабного реалити шоу, получила звание «самая прекрасная женщина» и миллион рублей. Не пью вообще, не курю. Активно развиваю инстаграм, много в него вкладываю. Моя работа для меня как хобби и отдых, но свободное время могу проводить по-разному, все зависит от настроения, как правило это что-то спокойное и умиротворенное. Вегетарианка, но иногда ем рыбу или морепродукты. Я хочу создать семью, родить детей с надежным мужчиной, желательно русским, так как менталитет иностранца может быть чужд.','5315fbf7-8642-11ee-84d2-005056c00001'),(17,'Наташа','89111134556','mow',3.9,1,15,'Высшее образование, свободно владею английским, умею водить авто и мотоцикл. Мастер спорта по художественной гимнастике,сейчас профессионально танцую все виды танцев, делаю свой контент по растяжке, шпагату, хочу открыть свой студию воздушной гимнастки. Участвовала в конкурсах красоты, но не стала заниматься профессионально модельной деятельностью. Бегаю в лесу, прыгаю на лошадях, люблю готовить, вредных привычек нет. Ищу свою близкую душу, опору, плечо.','5315fd4e-8642-11ee-84d2-005056c00001'),(18,'Влада','89111134556','mow',4,1,16,'Окончила школу с золотой медалью. Поступила в Кубанский Государственный Университет на факультет РГФ «История Культуры России и Северной Америки» (Сравнительное культуроведение и страноведение). После окончания продолжила обучение: магистратура «Журналистика и PR». Окончила с красным дипломом. Обучалась маркетингу. Работала моделью в США, Германии и Японии. Но больше относилась к этой деятельности как к хобби, так как получала серьезное образование. Работала на телеканале \"Кубань 24\" корреспондентом. Но сердцу осталась близка fashion-индустрия, поэтому в прошлом году официально открыла модельное агенство и буквально за год вывела его на первое место в Краснодаре. Сотрудничаю с московскими и международными модельными агентствами.','5315fe9c-8642-11ee-84d2-005056c00001'),(21,'Настенька','89881852588','mow',0,0,17,'','53160015-8642-11ee-84d2-005056c00001'),(22,'Настя','89282928971','mow',4.6,1,18,'Профессиональная фотомодель, занимаюсь танцами. Работаю в сфере эскорта.','53160167-8642-11ee-84d2-005056c00001'),(24,'Света','89611741561','mow',3.2,1,19,'Миниатюрная красотка буду рада встречи с порядочным, обеспеченным мужчиной. Встречи только на материальной основе','5316026b-8642-11ee-84d2-005056c00001'),(25,'Кира','89611741562','mow',4.2,1,20,'Работаю в сфере эскорта. Пиши если уверен в себе и знаешь чего хочешь!','5316036e-8642-11ee-84d2-005056c00001'),(26,'Жанна','89923456784','mow',3,1,21,'Милая развратница, приглашу в гости или приеду к тебе. Умею много, всегда на позитиве!','5316045b-8642-11ee-84d2-005056c00001'),(27,'Лилия','89922455678','mow',4.7,1,22,'Професионально танцую стриптиз. Работаю в сфере эскорта','5316055c-8642-11ee-84d2-005056c00001'),(28,'Николь','892929711766','led',4,1,23,'Эскорт! Эскорт! Эскорт!','5316064f-8642-11ee-84d2-005056c00001'),(29,'Алена','89211714671','led',3.8,1,24,'Алёна - девушка с прекрасной нежной кожей и очень красивыми чертами лица. Она очень внимательна к своей коже и следует строгому режиму ухода, чтобы всегда выглядеть здорово! Модель обожает заниматься спортом и обладает гибким и подтянутым телом. Её красивые черты лица помогают ей выглядеть очень привлекательно и деликатно. Она предоставляет эскорт-услуги в Москве и Спб, пишите!','53160738-8642-11ee-84d2-005056c00001'),(30,'Элона','89531311377','svx',3.4,1,25,'Элона - спортивная и горячая блондинка. Регулярно занимается спортом, чтобы держать свое тело в отличной форме. Просто обожает вечеринки и знакомства с новыми людьми. Готова быть вашей спутницей на любом мероприятии и привнести страсть и огонь любви в вашу жизнь!','53160840-8642-11ee-84d2-005056c00001'),(31,'Вика','89891234567','rov',4,1,26,'Ищу притягательного мужчину который готов идти со мной на маленькие приключения))) Спортивная, страстная девушка которая готова исполнить любой твой каприз. Хочу подарить тебе самую лучшую ночь в твоей жизни( а может и не одну)','5316092d-8642-11ee-84d2-005056c00001'),(32,'Ева','89181234556','krr',3.8,1,27,'Ева - красивая девушка с длинными русыми волосами и голубыми глазами. У неё отличное тело, которым она сможет доставить вам истинное удовольствие. Обладает особой энергетикой и обаянием, которое привлекает солидных мужчин. Очень общительная и легко находит общий язык с людьми, может поддержать любую беседу довольно начитанная девушка с высшим гуманитарным образованием.','53160a16-8642-11ee-84d2-005056c00001'),(33,'Иришка','89384556131','ovb',3.6,1,28,'Изящная и утонченная девушка. Она открыта всем телом и душой к новым знакомствам и просто обожает встречи в элитных ресторанах и на мероприятиях. Заказав эскорт-сопровождение от этой львицы, вы испытаете целую палитру незабываемых эмоций!','53160b29-8642-11ee-84d2-005056c00001'),(34,'Анжела','89111314556','led',4.7,1,29,'Модель, снимаюсь для рекламы в интернете (шоурум, магазин женской одежды, магазин женского белья). Занимаюсь спортом, 7 лет занималась гимнастикой, рисую. Стараюсь активно проводить свободное время. Обожаю гулять по утрам, хожу на различные культурные мероприятия, читаю. Умею и люблю готовить, к вредным привычкам отношение нейтральное. Буду рада познакомиться с приятным, состоятельным мужчиной. Подарю ему тепло, поддержку, эмоции и впечатления.','53160c1c-8642-11ee-84d2-005056c00001'),(35,'Мила','89111134599','led',4.6,1,30,'Родом из Сочи, но последнее время живу а США, учусь на дизайнера. Принимала участие в различных конкурсах красоты: «мисс Россия», «лучшая Модель юга России». Увлечения: путешествия, йога, пилатес, сёрфинг, дайвинг. Поддержу любой разговор на интересную тему.','53160d0c-8642-11ee-84d2-005056c00001'),(36,'Зайка','89111314577','led',4.1,1,31,'Яркая голубоглазая блондинка. Получаю высшее образование (социология и управление), работаю логистом в транспортной компании. Люблю читать книги (классическую литературу), есть художественное образование, умею готовить (любимое блюдо паста). Нейтральное отношение к вредным привычкам, хожу в спортзал. Есть загранпаспорт, допускаю переезд. Ищу властного, харизматичного мужчину, способного сделать меня счастливой, возможно женатого, для длительных отношений с содержанием (до этого на содержании не была).','53160df4-8642-11ee-84d2-005056c00001'),(37,'Каролина','89113461788','led',3.9,1,32,'Каролина - настоящая богиня соблазна и страсти. Её стройное тело словно создано для того, чтобы завораживать и вести в искушение. Её бёдра изгибаются совершенно идеально, а ноги кажутся бесконечными. Её кожа бархатиста и нежна на ощупь, словно персик. Но это не самое интересное в ней - Каролина горячая и страстная, и её характер точно не оставит равнодушным никого. Она умеет быть развратной и игривой, но и настоящей львицей в постели. Неудивительно, что мужчины просто падают к её ногам и не могут устоять перед её очарованием. С ней никогда не бывает скучно, и каждая встреча с ней - это настоящий подарок!','53160f0a-8642-11ee-84d2-005056c00001'),(38,'Стэла','89141814716','ovb',4,1,33,'Работаю моделью с 14 лет. Победительница многих конкурсов красоты: Top Model 2020, 1-я вице Мисс Россиянка 2019, Мисс натуральность 2019, 2-я вице мисс Всероссийская Императрица 2019, 2-я вице мисс Queen 2019, Indiva Fashion Moscow, Miss International 2019, Miss Fitnes 2019. Снималась в клипах, в сериале с Гошей Куценко, напечатали в журнале Anturag. Сдала ГТО на золото, занимаюсь фитнесом. Раньше занималась танцами, верховой ездой, бильярдом, скалалазаньем. Закончила музыкальную школу по трем специальностям (фортепиано, флейта, орган), пою. Блогер, вела канал на youtube, сейчас веду инстаграм, занимаюсь обработкой фотографий. Умею вкусно готовить. К курению отношусь крайне негативно, очень редко могу позволить себе выпить. Есть загранпаспорт, немного владею английским и немецким языками, планирую получить права, в будущем допускаю переезд.','5316102e-8642-11ee-84d2-005056c00001'),(39,'Ангелина','89241214556','ovb',4.3,1,34,'Фотомодель. Учусь на дизайнера. Много путешествую и всегда открыта к новым предложениям','531611e5-8642-11ee-84d2-005056c00001'),(40,'Яна','89161714556','ovb',3.2,1,35,'Хороший открытый человек, могу найти общий язык абсолютно со всеми. Много не нужно для счастья, но и в шалаш не готова переехать','53161330-8642-11ee-84d2-005056c00001'),(41,'Кристина','89651712346','ovb',4,1,36,'Молоденькая симпотяжка, жду своего принца. В эскорте совсем недавно, хочу лёгких отношений с материальной поддержкой','53161540-8642-11ee-84d2-005056c00001'),(42,'Катя','89277241686','mmk',3.9,1,37,'Окончила Университет им Лесгафта. Работаю тренером по художественной гимнастике, также моделью, хореографом, рисую. Участвовала в шоу \"Танцы\" на ТНТ.','5316165a-8642-11ee-84d2-005056c00001'),(43,'Лиза','89612314565','mmk',0,0,38,'','531617a0-8642-11ee-84d2-005056c00001'),(44,'Марина','89614566785','mmk',4.2,1,39,'анимаюсь спортом на регулярной основе, без вредных привычек. В поисках постоянных отношений, основанных на взаимной симпатии. Важна материальная поддержка от мужчины.','531618e8-8642-11ee-84d2-005056c00001'),(45,'Лара','89191234536','mmk',3.7,1,40,'Если тебе есть что предложить, то расмотрю любые варианты. Долгие переписки не веду, могу приехать сама!','53161a36-8642-11ee-84d2-005056c00001'),(46,'Виктория','89191234577','mmk',3.2,1,41,'Работаю, на учёбе в академе. Работы две: свой маленький бизнес в Таиланде удаленно и в компании управление проектом по развитию репутации в интернете - Online reputation management (сфера маркетинга). Учусь на маркетолога, получаю дополнительное образование. В академ ушла из-за загруженности в работе, пока что это приоритетнее. Образование которое уже есть: специалист по туризму, веб-дизайн. Из хобби: пишу картины, пишу музыку (в программе), изучаю игру на синтезаторе. Хочу встретить умного, успешного и сильного мужчину для отношений, потому что сама такая.','53161bb5-8642-11ee-84d2-005056c00001'),(47,'Лилия','89233445617','mmk',3.6,1,42,'Действующая фотомодель, участвую в различных показах. Всегда в поисках новых отношений и приятных встреч','53161cb2-8642-11ee-84d2-005056c00001'),(48,'Ника','89122471756','arh',3.8,1,43,'Люблю 