 клиниками Израиля. Люблю готовить, не курю, выпиваю по праздникам. Добрая, заботливая, воспитанная и уравновешенная. Есть шенген, допускаю переезд. Ищу постоянные отношения, в перспективе замужество, с успешным и заботливым мужчиной.','53165241-8642-11ee-84d2-005056c00001'),(89,'Виолета','89191415676','stw',2.8,1,84,'Индивидуалка, пиши всё обсудим!','53165340-8642-11ee-84d2-005056c00001'),(90,'Жанна','89191215676','stw',4.7,1,85,'Яркая красивая девушка в поисках интересных знакомств и острых ощущений. Очень люблю роскошь, и дорогие подарки. Готова подарить всю себя взамен!','53165428-8642-11ee-84d2-005056c00001'),(91,'Лиза','89211234556','kzn',4.9,1,86,'Профессионально танцую стриптиз, работаю в элитных клубах Москвы, расматривая переезд в другие регионы России','53165515-8642-11ee-84d2-005056c00001'),(92,'Ева','89121475676','kzn',3.9,1,87,'Высшее образование Fordham University, Bachelor degree in Economics, в совершенстве владею английским, есть водительские права. Сейчас занимаюсь консалтингом в fintech индустрии, занимаюсь изучением возможностей искусственного интеллекта, в будущем планирую интеллектом естественным контролировать работу искусственного, чтобы он зарабатывал деньги вместо меня. В прошлом являюсь сооснователем криптовалютой платформы на основе блокчейна. Получила визу талантов в Австралию как специалист в сфере fintech. Была председателем комитета по сбору средств на благотворительные проекты social club в Нью-Йорке, New York junior league (один самых престижных, старейших женских клубов, в которых состояли жена и дочери Дж.Буша, Элеонора Рузвельт и т.д. Хобби - цигун, теннис, верховая езда, вокал, бачата. Не люблю сильно острую еду. Ищу достойного, успешного, щедрого мужчину, которым захочется восхищаться, любить и заботиться, чтобы он стал для меня настоящим примером, вдохновлял меня на борщи и бизнесы, вместе мы исколесили весь мир, ну или весь Ямало-ненецкий автономный округ, если он не выездной, чтобы мы много смеялись и пили вино. Детей нет, 